import React from "react";
import Overview from "../Overview/Overview";
import { motion } from "framer-motion";
function Home() {
  return (
    <motion.div
      initial={{ x: -600 }}
      animate={{ y: 0, }}
      duration={{dalay:5}}
      transition={{
        type: "spring",
        stiffness: 260,
        damping: 20,
      }}
    >
      <Overview />
    </motion.div>
  );
}

export default Home;
